import React, {useState, useEffect} from 'react';
import { getAllOrders } from '../../../api/admin';
import classes from "./AdminOrders.module.css";
const AdminOrders = () => {

  const [orders, setOrders] = useState([]);

  useEffect(() => {
    const data = getAllOrders(localStorage.getItem("token"))
    data.then((result) => {
      setOrders(result)
    })
  }, []);


  if (orders) {
    return (
      <div className={classes.wrap}>
        <div className={classes.header}>
          <div onClick={SlideToWaiting}>
            <div style={{ border: WaitingStyle }}>Ждет подтверждения</div>
          </div>
          <div onClick={SlideToWork}>
            <div style={{ border: WorkStyle }}>В работе</div>
          </div>
          <div onClick={SlideToComleted}>
            <div style={{ border: ComletedStyle }}>Окончено</div>
          </div>
        </div>
        <div className={classes.wrapwrapcontent}>
          <div className={classes.wrapcontent} style={{ transform: SlideStyle }}>
            <div className={classes.waiting}>
              {orders[0].map((order) => (
                <div>
                  <div className={classes.orderheader}>
                    {order.date} {order.cell}
                  </div>   
                  <div className={classes.orderinfo}>
                    {order.data.map((orderInfo) => (
                      <div>
                        {orderInfo.super_type}/{orderInfo.type}/
                        {orderInfo.service} - {orderInfo.count}
                      </div>
                    ))}
                  </div>
                  <div className={classes.note}> {order.note} </div>
                </div>
              ))}
            </div>
            <div className={classes.work}>
              111111
              {orders[1].map((order) => (
                <div>
                  <div >
                    {order.date},
                    {order.note}, {order.cell}
                  </div>
                  <div>
                    {order.data.map((orderInfo) => (
                      <div>
                        {orderInfo.super_type}/{orderInfo.type}/
                        {orderInfo.service} - {orderInfo.count}
                      </div>
                    ))}
                  </div>
                </div>
              ))}
            </div>
            <div className={classes.completed}>
              222222
              {orders[2].map((order) => (
                <div>
                  <div>
                    {order.date},
                    {order.note}, {order.cell}
                  </div>
                  <div>
                    {order.data.map((orderInfo) => (
                      <div>
                        {orderInfo.super_type}/{orderInfo.type}/
                        {orderInfo.service} - {orderInfo.count}
                      </div>
                    ))}
                  </div>
                </div>
              ))}
            </div>
          </div>
        </div>
      </div>
    );
  }

};
export default AdminOrders;
